        params = []
        for i in range(num_params):
            if mode % 10 == 0:
                # position mode
                if len(self.program) <= self.program[self.index + 1 + i]:
                    # if program does not have enough params to fulfill the opcode, default to position 0
                    params.append(self.program[self.index + 1 + i])
                else:
                    params.append(self.program[self.program[self.index + 1 + i]])
            elif mode % 10 == 1:
                # immediate mode
                params.append(self.program[self.index + 1 + i])
            else:
                # relative mode
                if len(self.program) <= self.program[self.index + 1 + i] + self.relative_base:
                    # if program does not have enough params to fulfill the opcode, default to position 0
                    params.append(self.program[self.index + 1 + i] + self.relative_base)
                else:
                    params.append(self.program[self.program[self.index + 1 + i] + self.relative_base])
        return params

    def operate(self, opcode: int, params: List[int], write: bool = False):
        params.reverse()

        if opcode == 1:
            self.program[params[2]] = params[0] + params[1]
        elif opcode == 2:
            self.program[params[2]] = params[0] * params[1]
        elif opcode == 3:
            if len(self.stdin) == 0:
                return
            else:
                self.program[params[0]] = self.stdin.pop()
        elif opcode == 4:
            return params[0]
        elif opcode == 5:
