        elif opcode == 8:
            if params[0] == params[1]:
                self.program[params[2]] = 1
            else:
                self.program[params[2]] = 0
        elif opcode == 9:
            self.relative_base += params[0]
        elif opcode == 99:
            raise StopIteration()
        else:
